import datetime
import hashlib
from typing import List, Dict, Optional
from dataclasses import dataclass

# Database simulation
class Database:
    def __init__(self):
        self.submissions = {}
        self.validation_rules = {}
        self.users = {}
        self.lock_windows = []
        self.user_permissions = {}
        self.cached_files = set()

    def delete_data_by_date(self, date: datetime.date) -> int:
        count = 0
        to_delete = []
        for sub_id, submission in self.submissions.items():
            if submission.submission_date == date:
                to_delete.append(sub_id)
                count += 1

        for sub_id in to_delete:
            del self.submissions[sub_id]
        return count

    def update_submission_status(self, submission_id: str, status: str) -> bool:
        if submission_id in self.submissions:
            self.submissions[submission_id].status = status
            return True
        return False

    def get_submission(self, submission_id: str) -> Optional[dict]:
        return self.submissions.get(submission_id)

    def add_validation_rule(self, rule_id: str, rule: dict) -> None:
        self.validation_rules[rule_id] = rule

    def add_lock_window(self, start: datetime.datetime, end: datetime.datetime) -> None:
        self.lock_windows.append((start, end))

    def is_locked(self, when: datetime.datetime) -> bool:
        for start, end in self.lock_windows:
            if start <= when <= end:
                return True
        return False

    def cache_file_request(self, request_hash: str) -> bool:
        if request_hash in self.cached_files:
            return False
        self.cached_files.add(request_hash)
        return True

    def set_user_permission(self, user_id: str, permission: str, value: bool) -> None:
        if user_id not in self.user_permissions:
            self.user_permissions[user_id] = {}
        self.user_permissions[user_id][permission] = value

    def get_user_submissions(self, user_id: str) -> List[dict]:
        return [sub for sub in self.submissions.values() if sub.user_id == user_id]

@dataclass
class Submission:
    submission_id: str
    user_id: str
    submission_date: datetime.date
    status: str
    data: dict

class FABSSystem:
    def __init__(self):
        self.db = Database()

    def process_deletions_for_date(self, date_str: str) -> int:
        try:
            date = datetime.datetime.strptime(date_str, "%m-%d-%Y").date()
            return self.db.delete_data_by_date(date)
        except ValueError:
            raise ValueError("Invalid date format. Use MM-DD-YYYY")

    def update_fabs_status(self, submission_id: str, status: str) -> bool:
        if self.db.get_submission(submission_id) and status in ["draft", "validated", "published"]:
            # Prevent double publishing
            current_status = self.db.get_submission(submission_id).status
            if current_status == "published" and status == "published":
                return False
            return self.db.update_submission_status(submission_id, status)
        return False

    def validate_submission(self, submission_data: dict) -> Dict[str, List[str]]:
        errors = {}
        # Sample validation rules
        if "agency_code" not in submission_data:
            errors["agency_code"] = ["Missing required field: agency_code"]
        if "office_code" in submission_data and not self._validate_office_code(submission_data["office_code"]):
            errors["office_code"] = ["Invalid office code format"]
        return errors

    def _validate_office_code(self, code: str) -> bool:
        return len(code) == 4 and code.isalnum()

    def update_validation_rules(self, rule_id: str, rule: dict) -> None:
        self.db.add_validation_rule(rule_id, rule)

    def add_gtas_lock_window(self, start: str, end: str) -> None:
        start_dt = datetime.datetime.strptime(start, "%Y-%m-%d %H:%M")
        end_dt = datetime.datetime.strptime(end, "%Y-%m-%d %H:%M")
        self.db.add_lock_window(start_dt, end_dt)

    def generate_d_file(self, submission_id: str, sync_fpds: bool = False) -> Optional[str]:
        submission = self.db.get_submission(submission_id)
        if not submission:
            return None

        # Create hash for caching
        data_hash = hashlib.md5(str(submission.data).encode()).hexdigest()
        cache_key = f"{submission_id}_{data_hash}"

        if not self.db.cache_file_request(cache_key):
            return None  # Already generated

        # Simulate D File generation
        d_file = f"D_FILE_{submission_id}.txt"
        if sync_fpds:
            d_file += ".synced"
        return d_file

    def get_office_name(self, office_code: str) -> str:
        # Simulate office code to name mapping
        office_names = {
            "ABCD": "Office of Administration",
            "EFGH": "Office of Budget",
            "IJKL": "Office of Contracts"
        }
        return office_names.get(office_code, "Unknown Office")

    def derive_funding_agency_code(self, submission_data: dict) -> Optional[str]:
        # Sample derivation logic
        if "award_id" in submission_data:
            return submission_data["award_id"][:4]
        return None

    def set_user_permission(self, user_id: str, permission: str, value: bool) -> None:
        self.db.set_user_permission(user_id, permission, value)

    def get_user_submissions(self, user_id: str) -> List[dict]:
        return self.db.get_user_submissions(user_id)

